const ipToInt32 = (ip) => {
    return ip.split(".").reduce((int, v) => int * 256 + +v);
}

var IP_IGNORE_BITS = 1;

function isInOverseaNet(host) {
    let low = 0, high = _net_count -1;
    let ip = ipToInt32(host) >>> IP_IGNORE_BITS;

    while (low <= high) {
	let mid = (low + high) >>> 1;
	let pref = _net_list[mid].prefix;
	let msk1 = (~0 >>> pref) >>> IP_IGNORE_BITS;
	let net0 = _net_list[mid].net >>> IP_IGNORE_BITS;

	if ((ip & ~msk1) == net0)
	    return true;

	if (net0 > ip) {
	    high = mid - 1;
	} else if (net0 < ip) {
	    low = mid + 1;
	} else {
	    break;
	}
    }

    return false;
}

exports.isInOverseaNet = isInOverseaNet;
